import React from 'react';
import logo from './logo.svg';
import './App.css';
import TodoList from './todolist.js';

function App() {
  return (
    <div className="App">
      <center>
        <div id="static">
          <div id="siteheader" class="siteheader">
            THINGS TO DO
          </div>
          <br />
          <div id="subheadertext" class="subheadertext">
            A TO-DO LIST WEBSITE FOR KNOWING WHAT TO DO
          </div>
        </div>
      </center>
      <center>
        <div id="dynamic">
          <TodoList />
        </div>
      </center>
    </div>
  );
}

export default App;
